        require(tx.origin == msg.sender, "No contract bots");
        _;
    }

    function mint() external payable noContract {
        require(minted[msg.sender] < MAX_PER_WALLET, "Mint limit");
        minted[msg.sender]++;
        // Mint logic
    }
}

